drop table if exists numeric_types_number;
create table numeric_types_number(num_val NUMBER);

drop table if exists numeric_types_float;
create table numeric_types_float(num_val FLOAT(5));

drop table if exists numeric_types_binary_float;
create table numeric_types_binary_float(num_val BINARY_FLOAT);

drop table if exists numeric_types_binary_double;
create table numeric_types_binary_double(num_val BINARY_DOUBLE);

drop table if exists numeric_types;
create table numeric_types(num_val NUMBER,float_val FLOAT(5), bin_float_val BINARY_FLOAT, bin_double_val BINARY_DOUBLE);

drop table if exists date_time_types;
create table date_time_types(date_val DATE,timestamp_val TIMESTAMP(9),ts_tz_value TIMESTAMP WITH TIME ZONE, ts_tz_lt_value TIMESTAMP WITH LOCAL TIME ZONE);

drop table if exists interval_types;
CREATE TABLE interval_types(int_y_m INTERVAL YEAR(4) TO MONTH,int_d_s INTERVAL DAY(9) TO SECOND(9));

drop table if exists CHAR_TYPES;
CREATE TABLE CHAR_TYPES(EMP_NAME VARCHAR2(1000),address NVARCHAR2(1000),address_2 CHAR(1000),address_3 NCHAR(1000));
